script: |
  super -f text -I q10692.spq | sort > q10692.out

inputs:
  - name: q10692.spq
    data: |
      SELECT DISTINCT - col1 AS col0 FROM tab1 (FORMAT parquet) WHERE - + 63 * + col0 NOT IN ( - ( - 53 ) + - + col0 );
  - name: tab1

outputs:
  - name: q10692.out
    data: |
      -14
      -47
      -5
